// src/components/academic/Academic.js

import React from "react";
import "./Headline.css";
export default function Headline() {
  return (
    <>
      <div class="headline-container">
        <fieldset>
          <legend>
            <h1>I'm just getting started!</h1>
          </legend>
        </fieldset>
      </div>
    </>
  );
}
